            "created": 1462199367000, 
            "description": "<p>Data Visualization DC and Graphicacy Present:</p> <p><br/><b><i>The Major League Data Viz Challenge Awards!</i></b></p> <p>Join your fellow data visualizers\u00a0on Wednesday\u00a0May, 25th for the\u00a0Data Viz Challenge Awards. This May DVDC and our partners at Graphicacy will be awarding prizes for the best data visualizations of 2016!</p> <p>Data Viz entries we received in March and have been judged on Form, Function, Originality, and Effectiveness. We are honored to be giving out the following prizes to the winners:</p> <p>\u2022\u00a0Grand prize: $1,000\u00a0</p> <p>\u2022 Gold: $500</p> <p>\u2022\u00a0Silver: $300</p> <p>\u2022\u00a0Bronze: $150</p> <p>The judges include Sean Gonzalez, Nathaniel Pearlman, Richard Saul Wurman, Taegan Goddard, Nicco Mele, Patrick Ruffini, and Nicole Melander:</p> <p><img src=\"http://photos4.meetupstatic.com/photos/event/e/2/4/e/600_449577934.jpeg\" /></p> <p><img src=\"http://photos3.meetupstatic.com/photos/event/e/2/5/6/600_449577942.jpeg\" /></p> <p>The Major League Data Viz Challenge Awards\u00a0will be held at Capital One\u2019s McLean, Virginia office (1680 Capital One Drive, McLean, VA[masked]), right across the street from the Silver Line\u2019s McLean Metro Station, and we recommend that you take the train if you want to stay for data drinks after.\u00a0</p> <p>To access Capital One\u2019s Mclean Headquarters, please confirm your RSVP as soon as possible, and bring a recent government ID with you the night of the event.</p> <p>We look forward to seeing you! \u00a0</p> <p>\n\n\n<b>Agenda:</b></p> <p>\u2022\u00a06:30 - Food/Drink, Networking</p> <p>\u2022\u00a07:00 - Introductions, Announcements</p> <p>\u2022\u00a07:10 - Presentation #1</p> <p>\u2022\u00a07:35 - Presentation #2</p> <p>\u2022\u00a08:00 - Q&amp;A, Break</p> <p>\u2022\u00a08:10 - Winner Presentation</p> <p>\u2022\u00a08:35 - Awards</p> <p>\u2022\u00a08:40 - Q&amp;A</p> <p>\n\n\n<b>Announcing DATABLE!</b></p> <p>Are you Datable? <a href=\"http://datable.org/\">Apply here</a>.</p> <p>Datable is speed dating for Data Practitioners and Data Driven Companies.</p> <p>Datable is a new way for DC2 to provide career services to our community. Our educational events are free and open but attending them all can become a full time job! So DC2 is gathering our career minded members and the best data driven companies and bringing the best together at Datable.\u00a0</p>", 
